const SubjectSelection = () => {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        border: "1px solid black",
        padding: "10px",
        borderRadius: "5px",
        width: "300px",
        height: "300px",
        margin: "auto",
        marginTop: "200px",
        textAlign: "center",
      }}
    >
      <h2>Select subject</h2>
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          justifyContent: "center",
          alignItems: "center",
          gap: "15px",
          padding: "10px",
        }}
      >
        <div
          style={{
            padding: "8px",
            backgroundColor: "#E5D9F2",
            border: "1px solid black",
            borderRadius: "5px",
          }}
        >
          Physics
        </div>
        <div
          style={{
            padding: "8px",
            backgroundColor: "#E5D9F2",
            border: "1px solid black",
            borderRadius: "5px",
          }}
        >
          Chemistry
        </div>
        <div
          style={{
            padding: "8px",
            backgroundColor: "#E5D9F2",
            border: "1px solid black",
            borderRadius: "5px",
            display: "flex",
          }}
        >
          <p>Mathematics</p>
          <div><img src="/maths.png"/></div>
        </div>
      </div>
    </div>
  );
};

export default SubjectSelection;
